/*
Plugin Name: Image Popup Js Plugin
Plugin version: 1.0.0
Plugin Author: vishwajeet kumar
About Plugin: This Plugin will help you to create pop up image whenever you click on any image on your webpage. This can work in three ways 1. popup all the images of a webpage 2. popup only image inside a div with a paticular id 3. popup all images which has a similar class.
 */
function closePopUp(){document.getElementById('mainPopImage').src="";document.getElementById('vis-popup').style.display="none"}function includePopupHTML(){var html="<div id='vis-popup'><span id='close' onclick='closePopUp()'><img id='npop' src='data:image/png;base64,' alt=''></span><img id='mainPopImage' src='https://img00.deviantart.net/f33c/i/2011/139/f/c/vertical_panorama_by_verticaldubai-d3gp1ja.jpg' alt=''></div>";var bodytag=document.body;var popdiv=document.createElement("div");popdiv.innerHTML=html;bodytag.insertBefore(popdiv,bodytag.firstChild)}function imagePopupInit(options){var type='allImage';var img="";includePopupHTML();if(typeof yourvar==='undefined'){type='allImage'}if(options.type=='allImage'){img=document.getElementsByTagName("img")}else if(options.type=='insideDiv'){var divId=document.getElementById(options.target);img=divId.getElementsByTagName("img")}else if(options.type=='imageClass'){img=document.getElementsByClassName(options.target)}for(var i=0;i<img.length;i++){img[i].style.cursor='pointer';img[i].addEventListener("click",function(){if(this.id!='npop'){document.getElementById("mainPopImage").src=this.src;document.getElementById("vis-popup").style.display='block'}})}}